import React from 'react';
import Container from '@/screen/Container';
import { Title, Paragraph, CodeBlock } from '@/components/SubComponent';

class Array_filter extends React.Component {
  render() {
    return (
      <Container>
        <div style={{padding: '0 10px'}}>
          <Title title={'手写数组 filter 方法'}></Title>
          <Paragraph title={'依照 ecma262 草案，实现的 filter 的规范如下:'}></Paragraph>
          <img style={{width: '100%'}} src="data:image/webp;base64, " alt="img"/>
          <Paragraph title={'代码如下:'}></Paragraph>
<CodeBlock content={
`
Array.prototype.filter = function(callbackfn, thisArg) {
  // 处理数组类型异常
  if (this === null || this === undefined) {
    throw new TypeError("Cannot read property 'filter' of null or undefined");
  }
  // 处理回调类型异常
  if (Object.prototype.toString.call(callbackfn) != "[object Function]") {
    throw new TypeError(callbackfn + ' is not a function')
  }
  let O = Object(this);
  let len = O.length >>> 0;
  let resLen = 0;
  let res = [];
  for(let i = 0; i < len; i++) {
    if (i in O) {
      let element = O[i];
      if (callbackfn.call(thisArg, O[i], i, O)) {
        res[resLen++] = element;
      }
    }
  }
  return res;
}
`
}
/>
        </div>
      </Container>
    );
  }
}

export default Array_filter;